INSERT INTO `goods` VALUES ('8', '青橙N3', '36', '1799.00', '0', '1', '“型”影不离\r\n    全网通 自由切换 支持盲插\r\n    FHD超清大屏\r\n    0.5秒 指纹解锁\r\n    HotKnot 碰触传输\r\n    1300万高清摄像头');
INSERT INTO `goods` VALUES ('9', '青橙M4', '36', '1299.00', '50', '1', '指为你精彩\r\n\r\n    指纹识别\r\n    8核64位强劲处理器\r\n    移动/联通/电信4G手机\r\n    可拆卸 超大电池\r\n    熄屏解锁');
INSERT INTO `goods` VALUES ('10', '青橙C1', '1', '399.00', '48', '1', '好品 好用 好看的手机\r\n\r\n    双卡双待\r\n    移动4G/联通2G\r\n    超长待机\r\n    超高性价比\r\n    支持内存卡扩展');
INSERT INTO `goods` VALUES ('11', '青橙VOGA V1', '1', '3499.00', '28', '1', '青橙VOGA V1号称”年轻人第一部户外运动手机”，主打的部分自然也放在了户外运动这一特点上。青橙VOGA V1采用了航空级玻纤聚碳酸酯与拜耳亲肤高弹分子材料，打造军用级防护，精密结构设计与适应宽温操作的AMOLED屏确保了青橙VOGA V1在极寒、极热环境下都能够顺畅运行。');
INSERT INTO `goods` VALUES ('12', '青橙N2', '1', '1599.00', '34', '0', '弧动之美 一触即发\r\n移动/联通/电信4G手机 \r\n全金属工艺 5.5寸高清大屏\r\n熄屏解锁 PTT一键对讲');
INSERT INTO `goods` VALUES ('13', '青橙N20', '1', '999.00', '55', '1', '一款高质价比的手机\r\n\r\n    5.5寸高清大屏\r\n    双卡双待\r\n    移动/联通/电信4G手机 自由切换\r\n    1300万高清摄像头\r\n    PTT一键对讲功能');
INSERT INTO `goods` VALUES ('14', 'M4配件大礼包', '1', '39.00', '40', '1', '礼包包含高透贴膜一张和炫彩外壳一个');
INSERT INTO `goods` VALUES ('15', '青橙N2/N20专用钢化膜', '4', '29.90', '40', '1', '1.高强度防刮\r\n2.高清晰\r\n3.防指纹\r\n4.触摸顺滑\r\n5.反应灵敏');
INSERT INTO `goods` VALUES ('16', '青橙N2专用保护壳', '4', '19.90', '23', '1', '独特的磨砂工艺,超薄外观精致,手感细腻,简约时尚,采用环保PC材料,为您的健康着想');
INSERT INTO `goods` VALUES ('17', '青橙标准耳机', '4', '29.00', '13', '1', '可线控操作,入耳式设计.简约外观金属耳壳设计,彰显独特个性');
